import React from 'react'

type PropsType = {
    content: Array<{id: number,
    Title: string,
    BrowserTitle: string,
    MetaDescription: string,
    UrlSlug: string,
    Content: string}>
}

export const Content = (props: PropsType) => {
    debugger


    return (
        props.content.map( c => (
            <div key = {c.id}>
            <title>{c.BrowserTitle}</title>
            <h2>{c.Title}</h2>
            <p>{c.Content}</p>
            </div>
            ))
    )
}
